import React from 'react';
import './App.css';

function App() {
    return (
        <div className='app-wrapper'>
            <header className='header'>
                <img src="https://www.logodesign.net/logo-new/owl-on-scale-legal-icon-6854ld.png" alt="logo"/>
            </header>
            <nav>
                <div>Profile</div>
                <div>Messages</div>
            </nav>
            <div>Main content</div>
        </div>
    );
}


export default App;
